              <div className="row">
                  <h4 className="section-title">About</h4>
              </div>
              <div className="col-sm-6 col-md-4">
               <div className="stella">
                 
                 <img src="src\images\stella.jpg" className="stella" alt="pi"></img>
                 <h3>Stella Belessi</h3>
                 <div className= "stella-info"></div>
                  <p> Film Director</p>
                  
                </div>    
             </div>
          </div>
        </section> 
      );
}

